import { gql } from 'apollo-boost';

export const GET_REPOSITORIES = gql`
query getRepositories($orderDirection:Int!){
  getRepositories(orderDirection:$orderDirection){
    edges{
      node{
        fullName
        ratingAverage
        reviewCount
        forksCount
        language
        description
        ownerAvatarUrl
      }
    }
  }
} 
`;
